import React, { useState } from 'react';
import { useDrag } from 'react-dnd';
import EXTENDED_LIBRARY from '../../constants/ExtendedLibrary';
import '../../styles/CreateLanding.css';

const ComponentLibrary = ({ isCollapsed, onToggle, addSection, addElement }) => {
    const ItemTypes = {
        SECTION: 'section',
        ELEMENT: 'element',
    };

    const [selectedCategory, setSelectedCategory] = useState(Object.keys(EXTENDED_LIBRARY)[0]);
    const [selectedSubCategory, setSelectedSubCategory] = useState(
        EXTENDED_LIBRARY[Object.keys(EXTENDED_LIBRARY)[0]].subCategories[0]?.id || null
    );

    const DraggableTemplate = ({ template, type }) => {
        const [{ isDragging }, drag] = useDrag(() => ({
            type: type === 'section' || type === 'popup' || type === 'template' ? ItemTypes.SECTION : ItemTypes.ELEMENT,
            item: {
                id: template.id,
                json: template.json,
            },
            collect: (monitor) => ({
                isDragging: !!monitor.isDragging(),
            }),
        }));

        const renderTemplatePreview = () => {
            const { type, componentData = {}, styles = { desktop: {} }, children = [] } = template.json || {};
            const previewStyle = {
                ...styles.desktop,
                position: 'relative',
                maxWidth: '100%',
                minHeight: type === 'form' ? '150px' : type === 'gallery' || type === 'carousel' ? '180px' : '120px',
            };

            switch (type) {
                case 'section':
                case 'popup':
                case 'template':
                    return (
                        <div style={previewStyle} className={`component-library-template-item ${type}`}>
                            <h3>{componentData.title || 'Section'}</h3>
                            {children.length > 0 && (
                                <div style={{ display: 'flex', flexDirection: 'column', gap: '8px' }}>
                                    {children.map((child) => (
                                        <div key={child.id} style={child.styles.desktop}>
                                            {child.type === 'image' ? (
                                                <img src={child.componentData.src} alt={child.componentData.alt} />
                                            ) : (
                                                <span>{child.componentData.content || child.componentData.label}</span>
                                            )}
                                        </div>
                                    ))}
                                </div>
                            )}
                        </div>
                    );
                case 'form':
                    return (
                        <div style={previewStyle} className="component-library-template-item form">
                            <form style={{ display: 'flex', flexDirection: 'column', gap: '8px' }}>
                                {children.map((child) => (
                                    <div key={child.id}>
                                        {child.type === 'input' ? (
                                            <input
                                                type={child.componentData.type}
                                                placeholder={child.componentData.label}
                                                style={child.styles.desktop}
                                            />
                                        ) : (
                                            <textarea
                                                placeholder={child.componentData.label}
                                                style={child.styles.desktop}
                                            />
                                        )}
                                    </div>
                                ))}
                                <button style={{ padding: '8px', borderRadius: '4px' }}>Submit</button>
                            </form>
                        </div>
                    );
                case 'button-group':
                    return (
                        <div style={previewStyle} className="component-library-template-item">
                            <div style={{ display: 'flex', gap: '8px' }}>
                                {children.map((child) => (
                                    <button key={child.id} style={child.styles.desktop}>
                                        {child.componentData.content}
                                    </button>
                                ))}
                            </div>
                        </div>
                    );
                case 'gallery':
                case 'carousel':
                    return (
                        <div style={previewStyle} className={`component-library-template-item ${type}`}>
                            <div style={{ display: type === 'carousel' ? 'flex' : 'flex', flexWrap: type === 'gallery' ? 'wrap' : 'nowrap', gap: '8px' }}>
                                {children.map((child) => (
                                    <img
                                        key={child.id}
                                        src={child.componentData.src}
                                        alt={child.componentData.alt}
                                        style={child.styles.desktop}
                                    />
                                ))}
                            </div>
                        </div>
                    );
                case 'heading':
                    return (
                        <h2 style={previewStyle} className="component-library-template-item">
                            {componentData.content || 'Tiêu đề'}
                        </h2>
                    );
                case 'paragraph':
                    return (
                        <p style={previewStyle} className="component-library-template-item">
                            {componentData.content || 'Đoạn văn'}
                        </p>
                    );
                case 'button':
                    return (
                        <button style={previewStyle} className="component-library-template-item">
                            {componentData.content || 'Nút'}
                        </button>
                    );
                case 'image':
                    return (
                        <img
                            src={componentData.src || componentData.images?.[0]?.src || 'https://via.placeholder.com/150'}
                            alt={componentData.alt || 'Image'}
                            style={previewStyle}
                            className="component-library-template-item"
                        />
                    );
                default:
                    return (
                        <div style={previewStyle} className="component-library-template-item">
                            {componentData.title || componentData.content || 'Unknown'}
                        </div>
                    );
            }
        };

        return (
            <div
                ref={drag}
                className={`component-library-template-item ${isDragging ? 'dragging' : ''} ${template.json.type}`}
            >
                {renderTemplatePreview()}
            </div>
        );
    };

    return (
        <div className={`component-library-container ${isCollapsed ? 'component-library-collapsed' : ''}`}>
            <div className="component-library-header">
                <h2 className="component-library-title">Thư viện thành phần</h2>
                <button onClick={onToggle} className="component-library-toggle">
                    <i className={isCollapsed ? 'fas fa-chevron-right' : 'fas fa-chevron-left'}></i>
                </button>
            </div>
            {!isCollapsed && (
                <div className="component-library-wrapper">
                    <div className="component-library-category-nav">
                        {Object.entries(EXTENDED_LIBRARY).map(([categoryKey, category]) => (
                            <button
                                key={categoryKey}
                                className={`component-library-category-btn ${selectedCategory === categoryKey ? 'active' : ''}`}
                                onClick={() => {
                                    setSelectedCategory(categoryKey);
                                    setSelectedSubCategory(category.subCategories[0]?.id || null);
                                }}
                            >
                                <i className={category.icon}></i> {category.name}
                            </button>
                        ))}
                    </div>
                    <div className="component-library-subcategory-nav">
                        {EXTENDED_LIBRARY[selectedCategory]?.subCategories.map((subCategory) => (
                            <button
                                key={subCategory.id}
                                className={`component-library-subcategory-btn ${selectedSubCategory === subCategory.id ? 'active' : ''}`}
                                onClick={() => setSelectedSubCategory(subCategory.id)}
                            >
                                {subCategory.name}
                            </button>
                        ))}
                    </div>
                    <div className="component-library-template-column">
                        <div className="component-library-template-list">
                            {EXTENDED_LIBRARY[selectedCategory]?.subCategories
                                .find((sub) => sub.id === selectedSubCategory)
                                ?.templates.map((template) => (
                                    <DraggableTemplate
                                        key={template.id}
                                        template={template}
                                        type={selectedCategory === 'elements' ? 'element' : 'section'}
                                    />
                                ))}
                        </div>
                    </div>
                </div>
            )}
            {isCollapsed && (
                <div className="component-library-category-nav">
                    {Object.entries(EXTENDED_LIBRARY).map(([categoryKey, category]) => (
                        <button
                            key={categoryKey}
                            className="component-library-icon-collapsed"
                            title={category.name}
                            onClick={() => {
                                setSelectedCategory(categoryKey);
                                setSelectedSubCategory(category.subCategories[0]?.id || null);
                                onToggle();
                            }}
                        >
                            <i className={category.icon}></i>
                        </button>
                    ))}
                </div>
            )}
        </div>
    );
};

export default ComponentLibrary;
